const HomePage = () => {
    return(
        <>
            <h1>Hello, welcome to my blog!</h1>
            <p>
                Maecenas sagittis placerat libero, tempor porta diam euismod eget. Suspendisse lobortis metus at nisi ornare, et ultricies ligula scelerisque. Vestibulum euismod consequat odio vitae volutpat. Pellentesque non accumsan nulla. Nunc dignissim cursus diam, rhoncus semper orci maximus nec. Sed vestibulum turpis nec diam imperdiet, ut fermentum velit fringilla. Ut sit amet ipsum enim. Nullam non massa eu sapien accumsan eleifend. Integer at mauris ultrices, efficitur nulla in, fringilla quam. Sed bibendum pretium mi. Nullam eget mi leo. Integer sit amet pharetra justo, non luctus metus. Etiam fermentum faucibus mi in iaculis. Nulla vel fermentum nisl.
            </p>
            <p>
                Sed fermentum quam id dolor placerat fringilla. Proin luctus mattis massa, nec blandit justo dignissim a. Cras a dictum justo. Integer rutrum dui eu ornare vulputate. Suspendisse nec eros et nisl ullamcorper eleifend. Nunc consequat risus odio. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia curae; Suspendisse tempor neque in sagittis rutrum. Duis eleifend ornare enim, vehicula sollicitudin magna sodales vel. Nam felis elit, euismod nec enim vel, volutpat fermentum libero. Aenean fermentum arcu et condimentum malesuada. Fusce interdum lacinia sagittis. Quisque ut ante at tortor faucibus volutpat. Nulla egestas iaculis quam, eget blandit tellus. Mauris lobortis iaculis mauris eu tincidunt. Mauris eu gravida massa, sed maximus magna.
            </p>
            <p>
                Maecenas aliquam justo metus, nec malesuada tellus molestie vel. Pellentesque accumsan libero sit amet placerat fringilla. Nulla facilisis quis erat ac sodales. Vivamus nec tincidunt nibh, eget pulvinar sem. Vestibulum nec augue at dui vulputate tempor. Suspendisse pulvinar, ante in bibendum mollis, tellus arcu placerat nunc, eget gravida nibh felis nec orci. Suspendisse faucibus cursus pellentesque. Fusce porta sem id turpis posuere, et gravida felis ornare. Proin convallis mauris ipsum, nec consequat arcu ornare vitae. Donec eu elementum lorem. Duis finibus nulla eget ipsum iaculis vestibulum. Fusce euismod consectetur mauris et luctus. Fusce pellentesque at risus non gravida. Nunc maximus commodo ante, et tincidunt lorem. Praesent id sem at elit varius fringilla vel at ipsum. Ut ut laoreet dolor.
            </p>
        </>
    );
}

export default HomePage;
